import React from 'react';
import './TodoListForm';

const TodoList = (props) => {


    return(
        <div> 
            <ul className="collection with-header">
                <li className="collection-header"><h5>Todos</h5></li>
                {props.todos.map((item) => (
                    <div className="collection" key={item._id}>Name: {item.name} <br/> Todo: {item.todoItem} <br/> Date: {item.date} <br/> 
                     <button className="right btn-floating material-icons" type="grade" name="action">grade</button>
                     <button className="right btn-floating material-icons" type="edit" name="action">create</button>
                     <button className="right btn-floating material-icons" type="grade" name="action">delete</button>
                    </div>
                ))}
            </ul>
        </div>
    );
};

export default TodoList;
